import { NavLink } from "react-router-dom";
export const PageTopNav = ({ activeTabName }) => {
  const PageTopNavListData = [
    {
      backgroundColor: "white",
      color: "black",
      name: "Customers",
      link: "/max/Customer",
    },
    {
      backgroundColor: "white",
      color: "black",
      name: "Employees",
      link: "/max/employees",
    },
    {
      backgroundColor: "white",
      color: "black",
      name: "Sub-contractor",
      link: "/max/sub_contractors",
    },
    {
      backgroundColor: "#3499ff",
      color: "white",
      name: "Receptions",
      link: "/max/receptions",
    },
    {
      backgroundColor: "white",
      color: "black",
      name: "Refereers",
      link: "/max/refereers",
    },
  ];
  const PageTopNavListApp = (props) => {
    return (
      <NavLink to={props.link}>
        <div
          style={{
            backgroundColor: props.isActive ? "red" : "white",
            color: props.color,
          }}
          className=" page_top_nav_link"
        >
          {props.name}
        </div>
      </NavLink>
    );
  };
  return (
    <>
      <div className="page_top_nav_div_top">
        <div className="page_top_nav">
          {PageTopNavListData.map((val, i) => {
            return (
              <PageTopNavListApp
                isActive={activeTabName === val.name}
                key={i}
                {...val}
              />
            );
          })}
        </div>
      </div>
    </>
  );
};
